import './Codelock.css';
import { useState } from 'react';
const Codelock = () => {
    const [buttons, setButtons] = useState([]);

    for (let i = 0; i < 10; i++) {
        buttons.push(<div className="button"><p>{i}</p></div>)
        if (buttons.length = 10) {
            let tempBtnsArr = buttons;
            tempBtnsArr.shift();
            setButtons(tempBtnsArr);
            continue;
        }
    }
    console.log(buttons)
    return (
        <div className="codelock-container">
            {
                buttons.map((item, id) => {
                    return (
                        <div key={id}>{item}</div>
                    )
                })
            }
        </div>
    )
}

export default Codelock
